import React from 'react';
import { Box, Typography, Container, AppBar, Toolbar } from '@mui/material';

const Footer = () => {
  return (
	<Box sx={{ flexGrow: 1 }}>
    <AppBar position="static" color="primary" 
      sx={{ 
        top: 'auto', 
        bottom: 0, 
        backgroundColor: 'rgb(22, 22, 22)',
        position: 'static',
        width: '100vw',
        color: 'white',
        py: 2 // padding top and bottom
      }}>
      <Container maxWidth="lg" >
        <Toolbar >
          <Typography variant="body1" align="left" sx={{fontFamily: 'var(--font-family-ibm-plex-mono)'}}>
            Built in React Â© Nelson Rodriguez 2024
          </Typography>
        </Toolbar>
      </Container>
    </AppBar>
	</Box>
  );
};

export default Footer;
